void solve() {
    string s, t;
    cin >> s >> t;
    vector <int> ans;
    int n = s.size(), i, j, n2 = t.size();
    if (n < n2) {
        cout << 0 << endl;
        return;
    }
    vector <int> zxc(95, 0), zxc2(95, 0), pw(n2 + 1, 1);
    for (i = 1; i <= n2; i++) {
        pw[i] = (pw[i - 1] * k) % m1;
    }
    vector <int> keys;
    vector <int> keys2;
    for (i = 0; i < n2; i++) {
        for (j = 0; j < 95; j++) {
            zxc[j] = zxc[j] * k;
            zxc[j] %= m1;
            zxc2[j] = zxc2[j] * k;
            zxc2[j] %= m1;
        }
        zxc[t[i] - 33] += 1;
        zxc[t[i] - 33] %= m1;
        zxc2[s[i] - 33] += 1;
        zxc2[s[i] - 33] %= m1;
    }
    for (j = 0; j < 95; j++) {
        if (zxc[j] > 0) {
            keys.push_back(zxc[j]);
        }
        if (zxc2[j] > 0) {
            keys2.push_back(zxc2[j]);
        }
    }
    sort(all(keys));
    sort(all(keys2));
    if (keys == keys2) {
        ans.push_back(0);
    }
    for (i = 0; i + n2 < n; i++) {
        keys2.clear();
        for (j = 0; j < 95; j++) {
            zxc2[j] = zxc2[j] * k;
            zxc2[j] %= m1;
        }
        zxc2[s[i + n2] - 33] += 1;
        zxc2[s[i + n2] - 33] %= m1;
        zxc2[s[i] - 33] = (zxc2[s[i] - 33] + m1 - pw[n2]) % m1;
        for (j = 0; j < 95; j++) {
            if (zxc2[j] > 0) {
                keys2.push_back(zxc2[j]);
            }
        }
        if (keys2.size() != keys.size()) continue;
        sort(all(keys2));
        if (keys == keys2) {
            ans.push_back(i + 1);
        }
    }
    cout << ans.size() << endl;
    for (auto it : ans) {
        cout << it + 1 << " ";
    }
}

