            } else if (list1.get(0) < list2.get(0)) {
                list2.add(list2.get(0));
                list2.add(list1.get(0));

                list1.remove(0);
                list2.remove(0);

            } else  {

                list1.remove(0);
                list2.remove(0);
            }
        }

        int sum = 0;

        if (list1.size() > 0) {
            for (int i : list1) {
                sum += i;
