void solve(int tc){
    bool ok = true, can = false;
    cin >> n >> m;
    map<pair<ll,ll>,pair<ll,ll>>par;
    string ss[1009];
    string ans;
    map<pair<ll,ll>, char> mp;
    mp[{-1, 0}] = 'U';
    mp[{ 1, 0}] = 'D';
    mp[{0, -1}] = 'L';
    mp[{0, +1}] = 'R';
    for(int i=0;i<n;i++){
        cin >> ss[i];
    }
    for(int i=0;i<n;i++){
        for(int j=0;j<m;j++){
            if(ss[i][j]=='A'){
                par[{i, j}] = {-1, -1};
                x = i;
                y = j;
                break;
            }
        }
    }
    bool vis[n][m] = {0};
    ll path_length;
    queue<pair<pair<ll,ll>, ll>> q;
    q.push({{x, y}, 0});
    vis[x][y] = 1;
    while(!q.empty()){
        x = q.front().first.first;
        y = q.front().first.second;
        z = q.front().second;
        q.pop();
        
        if(ss[x][y]=='B'){
            path_length = z;
            can = true;
            break;
        }
        for(int i=0;i<4;i++){
            ll nx = x + dx[i];
            ll ny = y + dy[i];
            if(nx>=0 && nx<n && ny>=0 && ny<m && !vis[nx][ny] && ss[nx][ny]!='#'){
                vis[nx][ny] = 1;
                par[{nx, ny}] = {x, y};
                q.push({{nx, ny}, z+1});
            }
        } 
    }
    if(!can)no(1);
    //x y stores the position of B 
    else{
        yes(1);
        cout << path_length << endl;
        // return;
        int cnt = 0;
        while(ss[x][y]!='A'){
            // cout << x <<" "<<y << endl;
            ll nx = par[{x, y}].first;
            ll ny = par[{x, y}].second;
            ans.push_back(mp[{x - nx, y - ny}]);
            x = nx;
            y = ny;
        }
        
        for(int i=path_length-1;i>=0;i--){
            cout << ans[i];
        }
        cout << endl;
    }
    
    
}
 
 
